def RAND_CONF():
    x = np.random.random()*(X_MAX-X_MIN)+X_MIN
    y = np.random.random()*(Y_MAX-Y_MIN)+Y_MIN
    return {'x':x, 'y':y}

def NEAREST_VERTEX(g, q_rand):
    min_cost = None
    min_dist_id = None
    for node_id in g.nodes():
        dist_cost = calc_dist(g.node[node_id],q_rand)
        length_cost = g.node[node_id]['path_length']
        #safety_cost = g.node[node_id]['safety_cost']
        
        cost = dist_cost**2 + 0.05*length_cost**2
        
        if min_cost==None or cost < min_cost:
            min_cost = cost
            min_dist_id = node_id
    
    return min_dist_id

def link_free(q0, q1):
    global map_data
    
    x1 = q0['x']
    y1 = q0['y']
    x2 = q1['x']
    y2 = q1['y']
    
    x0 = np.array([x1, y1])
    vec = np.array([x2-x1, y2-y1])
    length = (vec[0]**2 + vec[1]**2)**0.5
    

    for scale in np.append(np.arange(0,length,0.1),length):
        (x,y) = x0 + scale/length*vec
        xi = int(x/0.1)
        yi = int(y/0.1)
        if map_data[xi+yi*map_width] > 0:
            return False
    return True


